import React from 'react';
import './App.css';

function App() {
  return (
    <div className="main-bg">
      <div className="center-symbol-row">
        <span className="big-brace">&#123;</span>
        <img src="/sss.png" alt="지구" className="big-globe" />
        <span className="big-brace">&#125;</span>
      </div>
    </div>
  );
}

export default App;
